import React, {Component} from 'react';
import './App.css';
import Menubar from './components/menubar';
import Login from './components/Login';

class App extends Component{
  render(){
    return(
      <div>
      <Menubar>
        <Login></Login>
      </Menubar>
      </div>
    );
  }
}

export default App;
